import React from 'react'
import SideNavbar from '../Components/SideNavbar'

export default function Profiles() {
  const Profile = () => {
    // Data profil 


  const userProfile = {


  name: 'dina aaspriyanti',
      email: 'dinoii900@gmail.com',
      address: 'Jl. Mawar No. 123, Jakarta',
      phone: '+62 812 3456 7890',
    };


    };

  return (
    <div class='text-center'>
    <div class='row'>
      <SideNavbar />
      {/* ini buat dashboard */}
      <div class='col-10'>
        <h2>Profiles</h2>
        <div className="card-body text-center">
              <img
                src="https://via.placeholder.com/150"
                alt="Profile"
                className="rounded-circle mb-3"
                style={{ width: '150px', height: '150px' }}
              />
              <h5 className="card-title mb-2">{userProfile.name}</h5>
              <p className="card-text">
                <strong>Email:</strong> {userProfile.email}
              </p>
              <p className="card-text">
                <strong>Alamat:</strong> {userProfile.address}
              </p>
              <p className="card-text">
                <strong>Telepon:</strong> {userProfile.phone}
              </p>

            </div>
      </div>
    </div>
  </div>
  )
}
